window.bookSummaryJSON = "<p>Seraphina Van Curen and Sebastian Cartier thought they were soul mates once upon a time. But for over a year, they have been well aware of just how quickly love can turn to hate and how cruel fate can be. </p><p>They might not be able to stand the sight of each other, but that's okay since they avoid each other like the plague. </p><p>When danger strikes too close to home, and ancient magic surfaces, they find themselves in the center of a deadly war. Seraphina and Sebastian strike an uneasy truce in order to end Dmitri Terletov, once and for all. They must work together to save what's left of the Kingdom and protect the people they love most. </p><p>Along the way, they discover fate isn't finished with them yet. </p><p>Fate is just getting started. </p>"; 
